import Head from 'next/head'
import MainLAyout from '../components/Mainlayout'

export default function Home() {
  return (
    <MainLAyout>
      <Head>
        
      </Head>

      <main >
      <div className="homeContainer">

      <div className="table-responsive table-active rowTop">
                <table className="table table-light ">
                    <thead>
                        <tr>
                        <th>Id</th>
                        <th>Firstname</th>
                        <th>Paid</th>
                        <th>Receiver</th>
                        <th>Mobile</th>
                        <th>Date</th>
                        <th>Cost</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                        <td>
                        <input className="form-control" type="text" id="text-input"/>
                        </td>
                        <td>
                        <select className="custom-select">
                        <option selected>Status</option>
                        <option value="1">One</option>
                        <option value="2">Two</option>
                        <option value="3">Three</option>
                    </select>
                        </td>
                        <td>
                        <select className="custom-select">
                        <option selected>Open this select menu</option>
                        <option value="1">One</option>
                        <option value="2">Two</option>
                        <option value="3">Three</option>
                    </select>
                        </td>
                        <td>
                        <input className="form-control" type="text" id="text-input"/>
                        </td>
                        <td>
                        <input className="form-control" type="text" id="text-input"/>
                        </td>
                        <td>
                        <input className="form-control " type="date" id="example-date-input"/>
                        </td>
                        <td>
                        <input className="form-control form" type="text" id="text-input"/>
                        </td>
                    
                        </tr>
                    </tbody>
                </table>
            </div>
          

           
            
      
        </div>
    
      </main>

      

      <style jsx>{`
       
       .bookingDetails{
           margin:1rem;
           display:flex;
           
       }
        @media screen and (max-width: 700px){
        .bookingDetails{
            
          margin:5px 0px;
        }
        }
       .bookingDetail{
           margin-left:10px;
           padding:30px 10px;
           display:flex;
           width:200px;
           flex-direction:column;
       }
       .bookingLabel{
            margin-left:10px;
            width:140px;
            
       }
       .form{
           border:none;
           border-bottom:3px solid gray;
       }    
       .labelText{
           margin-bottom:20px;
           font-size:20px;
           color:#2196F3;
           font-weight: 700;
           line-height:1.429; 
       }
       .labelText:after{
           content:"";
           display:block;
           width:120px;
           height:3px;
           background-color:black;
           margin-top:15px;
       }
      

      `}</style>
    </MainLAyout>
  )
}
